import './App.css';
import { Component } from 'react';

export default class App extends Component{

  constructor(props){
    super(props);
    this.props = {}

  }

  render(){ 

   const textoreal = "nombre del boton1";

  return (
    <div className="App">

       <Boton texto={textoreal}
       />
     <> <input type='text'>Introduce un archivo</input> </>

    </div>
    );
   }

}
